#!/usr/bin/env python3

def print_fibonacci(length):
    num1, num2 = 0, 1
    if length == 0:
        print("Kindly enter a positive integer")
    elif length == 1:
        print("Fibonancci sequence :")
        print(num1)
    else:
        print("Fibonacci Sequence : ")
        i = 0

        while i < length:
            print(num2)
            nth = num1 + num2
            num1 = num2
            num2 = nth
            i += 1



